module.exports = async () =>{
    await Department.remove({});
    await Employee.remove({});
    await Attendance.remove({});

    for(let i=0 ; i<departments.length ; i++){
        const dep = new Department({
            name: departments[i].name,
            description: departments[i].description
        });
        
        const emp = new Employee({
            firstName : employee[i].firstName,
            lastName : employee[i].lastName,
            surname : employee[i].surname,
            photo : employee[i].photo,
            birthday : employee[i].birthday,
            basicSalary : employee[i].basicSalary,
            email : employee[i].email,
            joinDate : employee[i].joinDate,
            department : employee[i].department
        });
        for(let j=0 ; j < 10 ; j++){
            const date = new Date(`05 ${j+1} 2019`);
            const att = new Attendance({
                attendanceDate : date.toDateString()
            })
            att.save();
            emp.attendance.push(att);
        }
        const day = new Date();
        const today = new Attendance({
            attendanceDate : day.toDateString()
        })
        today.save()
        emp.attendance.push(today);

        dep.employees.push(emp);
        dep.save();
        emp.save();
    }
}
